{{Infobox dungeon |name = Jagged Pass |image = [[File:Jagged Pass.png]] |caption = A map of Jagged Pass. |tokens = 22,000 |location = North of Route 112, east of Lavaridge Town. }} '''Jagged Pass''' is a [[Dungeons|dungeon]] in [[Hoenn]]. It initially has 49 tiles arranged in a 7x7 square, including 7 chest tiles, 17 non-boss encounter tiles, and 1 boss encounter tile.
